import axiosClient from './axiosClient';

const officeApi = {
    getAll: () => {
        const url = '/office';
        return axiosClient.get(url);
    },

    getByDepartment: (departmentId) => {
        const url = `/office/${departmentId}`;
        return axiosClient.get(url);
    }
};

export default officeApi;
